import React from "react";
import "../styles/Aboutme.css";
import pic from "../picture/anniversary.jpeg";

function Aboutme() {
  return ( 

    <>
    <div class = "pic">
        <img src={pic} alt="anniversary"/>
        <h1 class="text-3xl uppercase">William Pollak</h1>
          <p class="font-semibold mb-8">Web Developer</p>
     <h5> I currently live in thornton colorado, but am originally from michigan. I enjoy playing sports and video games in my free time. Web Developer trained at the University of Denver Coding Bootcamp and earned a full Stack Web Development Certificate. Innovative problem-solver passionate about developing apps, focused on mobile-first design and development. Strengths in creativity, teamwork, and building projects from ideation to execution. To secure a position that will utilize my skills and experience to maximum potential, with the opportunity for advancement based on performance. 
          </h5>
      </div>
      <h1 class="text-3xl uppercase">William Pollak</h1>
          <p class="font-semibold mb-8">Web Developer</p>
     <h5> I currently live in thornton colorado, but am originally from michigan. I enjoy playing sports and video games in my free time. Web Developer trained at the University of Denver Coding Bootcamp and earned a full Stack Web Development Certificate. Innovative problem-solver passionate about developing apps, focused on mobile-first design and development. Strengths in creativity, teamwork, and building projects from ideation to execution. To secure a position that will utilize my skills and experience to maximum potential, with the opportunity for advancement based on performance. 
          </h5>
 
  
        
      
         
          
   
      </>   
      
      
    );
    }

export default Aboutme;
